import React, { useEffect, useState } from 'react';
import axios from 'axios';

import PromotionCard from 'components/Address/Card/Card';


const PagesAddressSearch = () => {

  const [address, setAddress] = useState([])

  useEffect(() => {
    axios.get('http://localhost:5000/address')
    .then((response) => {
      setAddress(response.data);
      console.log(response.data);
    });
  }, []);


  return (
    <div 
      className='App'
      style={{
        maxWidth: 500,
        margin: '30px auto',
      }}>

      {address.map((address) => (
        <PromotionCard address={address} key={address.cep}/>  
      ))}
    </div>
  )
}

export default PagesAddressSearch;
